import React from 'react';
import { Link } from 'react-router-dom';

function CardClient({data}) {
    return (
        <>
        <li className='notepad-infos'>
            <Link to="/cliente/1">
                <div>
                    <strong>Nome: {data.first_name}</strong>
                </div>
            </Link>
        </li>
        </>
    )
}

export default CardClient;
